import shoppingCartIcon from '../../icons/shopping-cart.svg'

const Catalog = () => {
    return(
        <button className="header-notifications">
            <img width={20} height2 src={shoppingCartIcon} alt="notifications" />
        </button>
    )
}

export default Catalog;
